import React from "react";

const RecMsg = (props) => {
    return (
        <div className={"text-white p-3 bg-black flex-items-start max-w-[70%] rounded-lg"}>
            <p>{props.name}</p>
            <p>{props.phoneno}</p>
            <p>{props.msg}</p>
            <div className={"justify-between items-end sticky right-2"}><p className={""}>{props.time}</p></div>
        </div>
    );
    
}

export default RecMsg;
